\r\n Copy the EncoderParamet:
 将EncoderParameters数据复制到一块存储器中，以通过本机GDI+代码消耗。

 自从托管/未管理类的定义以来
 是不同的，本地班级有些怪异。本机encoderParameters类在GDI+中定义如下：

 类EncoderParameters {
     uint计数； //此结构中的参数数
     编码参数参数[1]; //参数值
 };

 我们没有“计数”字段，因为托管阵列包含它。为了使这种结构与多个
 编码参数仪我们需要对额外的N-1元素进行预先分配内存，这是这样的：

 encoderParameters* pencoderParameters =（encoderParameters*）malloc（sizeof（encoderParameters） +（n-1）* sizeof（encoderParameter））;

 此外，在64位平台中，“计数”在8个字节中对齐（4个额外的填充字节），因此我们使用INTPTR代替INT32来考虑
 那。

